  return (
    <div className="App">
      {/* <BrowserRouter> */}
        <Router>
          <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/signup" element={<SignUp />} />
          </Routes>
        </Router>
      {/* </BrowserRouter> */}
 <Login />
